#!/usr/bin/env bash
# need root

# ========== static ip ==========
# use abspath
tgp='/root/ipmac/'
ipmacJsonPath='/root/ipmac/ipmac.json'
    
GETIP=""
GETIP_F=$tgp"getip.sh"

SYSSERVICE="W1VuaXRdCkRlc2NyaXB0aW9uID0gZ2V0IGlwIGFuZCBrZWVwIGlwCgpbU2VydmljZV0KVHlwZT1zaW1wbGUKRXhlY1N0YXJ0PS9yb290L2lwbWFjL2dldGlwLnNoClJlc3RhcnQ9b24tZmFpbHVyZQpSZXN0YXJ0U2VjPTMKCltJbnN0YWxsXQpXYW50ZWRCeT1tdWx0aS11c2VyLnRhcmdldAoKIyB2aW06IGZ0PXN5c3RlbWQK"
SYSSERVICE_F=$tgp"ipmac.service"


mkdir -p $tgp
echo $GETIP | base64 -d > $GETIP_F
echo $SYSSERVICE | base64 -d > $SYSSERVICE_F

chown root:root $GETIP_F
chown root:root $SYSSERVICE_F
chmod 700 $GETIP_F
chmod 600 $SYSSERVICE_F

sed -i "s|IPMACPATH|$ipmacJsonPath|g" $GETIP_F
sed -i "s|PATH|$GETIP_F|g" $SYSSERVICE_F

cp $SYSSERVICE_F "/etc/systemd/system/"
systemctl daemon-reload
systemctl enable ipmac

# ========== allow ssh ==========
cat > /etc/ssh/sshd_config << EOF
Port 22
PermitRootLogin yes
PubkeyAuthentication yes
AuthorizedKeysFile  .ssh/authorized_keys
ChallengeResponseAuthentication no
UsePAM yes
AllowAgentForwarding yes
AllowTcpForwarding yes
X11Forwarding yes
PrintMotd no # pam does that
Subsystem   sftp    /usr/lib/ssh/sftp-server
EOF
systemctl restart sshd

mkdir -p /root/.ssh
cat >> /root/.ssh/authorized_keys << EOF
ssh-rsa  acm@ACM-Server
EOF

chown root:root /root/.ssh -R
chmod 600 /root/.ssh/authorized_keys


